import web from "../src/images/web1.png"
import android from "../src/images/mobile.jpg"
import digital from "../src/images/app.jpg"
import  marketing from "../src/images/app.jpg"
const Sdata=[
    {
        imgsrc: app,
        title:"App devlopment"
    },
    {
        imgsrc: software,
        title:"software Devlopment"
    },
    {
        imgsrc: web,
        title:"Web Devlopment"
    },
    {
        imgsrc: android,
        title:"Android Devlopment"
    },
    {
        imgsrc:digital,
        title:" Digital Marketing"
    },
    {
        imgsrc: marketing,
        title:"Markiting"
    },
]
export default Sdata;
